import { Component, Input, OnInit } from '@angular/core';
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
import { IEstudiante } from 'src/app/interface/iestudiante';
import { IMateria } from 'src/app/interface/imateria';
import { EstudianteService } from 'src/app/services/estudiante.service';

@Component({
  selector: 'app-pdf-reprobados',
  templateUrl: './pdf-reprobados.component.html',
  styleUrls: ['./pdf-reprobados.component.scss'],
})
export class PdfReprobadosComponent implements OnInit {
  nombreMateria = [];
  @Input() idUsuario: number;
  estudiante: IEstudiante;
  constructor(private _estudianteService: EstudianteService) {}

  ngOnInit() {
    let num = 0;
    this.nombreMateria.push([
      'No',
      'MATERIA',
      'CODIGO',
      'CREDITOS',
      'H.TEORICAS',
      'H.PRACTICAS',
      'NOTA',
    ]);
    
    this._estudianteService
      .getEstudianteById(this.idUsuario)
      .subscribe((resp) => {
        this.estudiante = resp;
        
        if (this.estudiante != null) {
          this._estudianteService
            .getAllMateriasReprobadas(this.estudiante.idEstudiante)
            .subscribe((resp) => {
              
              if (resp != null) {
                resp.forEach((e) => {
                  this._estudianteService
                    .getMateriaById(e.idMateria)
                    .subscribe((res) => {
                      this.nombreMateria.push([
                        num,
                        res[0].nombreMateria,
                        res[0].codigo,
                        res[0].horasTeoricas,
                        res[0].horasPracticas,
                        res[0].creditos,
                        e.promedio,
                      ]);
                      num++;
                      
                    });
                });
              }
            });
        }
      });
  }

  crearPdf() {
    
    const pdfContent: any = {
      content: [
        {
          image:
            'data:image/png;base64,',
            width: 500,
            height: 80
        },
        {
          text: '\n',
        },
        {
          text: 'ESTUDIANTE',
          style: 'header',
        },                
        {
          text: '--------------------------------------------------------------------------------------------------------------------------------------------------',
        },
        {
          text: 'Nombre: ' + this.estudiante.nombre,
        },
        {
          text: 'Apellido: ' + this.estudiante.apellido,
        },
        {
          text: '--------------------------------------------------------------------------------------------------------------------------------------------------',
        },                
        {
          text: 'REPORTE DE MATERIAS',
        },           
        
        {
          text: 'REPROBADAS',
          style: 'subheader',
        },
        {
          style: 'tableExample',
          table: {
            body: this.nombreMateria,
          },
        },
      ],
    };
    const pdf = pdfMake.createPdf(pdfContent);
    pdf.open();
  }
}
